/// 印出學生清單
func printStudent(_ students: [Student])
{
    var names = students.reduce("學生名單：")  { $0 + $1.名字 + "、" }
    names.removeLast()
    print(names + "。")
}


public func 作業測試(students: [Student], boxOfficeRank: (Int) -> Void)
{
    printStudent(students)
    print("-------------------")
    for year in [1993, 1995, 1997, 2011, 2012, 2019, 2020, 2021] {
        boxOfficeRank(year)
    }
